//react
import React from "react";

//bootstrap
import { Row, Container } from "reactstrap";
import { Button, Nav, Navbar } from "react-bootstrap";

// css and scss
import "./Navbar.css";
import "./Navbar.scss";

// router
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

const NavbarComponent = () => {
  return (
    <Router>
      <Navbar bg="custom-color" expand="lg">
        <Container>
          <Navbar.Text
            href=""
            className="text-white justify-content-start"
            id="logo-label"
          >
            Tom&Journey
          </Navbar.Text>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse
            id="basic-navbar-nav"
            className="justify-content-end"
          >
            <Nav
              variant="pills"
              fill
              // defaultActiveKey={location.pathname}
              className="pill-color"
            >
              <Nav.Item>
                <Nav.Link
                  as={Link}
                  to={"/home"}
                  eventKey="link-home"
                  // href="#"
                  className="text-white custom-size-1 "
                  id="custom-font-bold-1 Home-label"
                >
                  Home
                </Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link
                  href="#"
                  eventKey="link-trip-planner"
                  className="text-white  custom-size-1 "
                  id="custom-font-medium-1 Trip-label"
                >
                  Trip Planner
                </Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link
                  href="#"
                  eventKey="link-login"
                  className="text-white  custom-size-1 "
                  id="custom-font-medium-1 Login-label"
                >
                  Login
                </Nav.Link>
              </Nav.Item>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </Router>
  );
};

export default NavbarComponent;
